column3:
{pageend:Quest’area è molto frequentata.}
Potresti approfittarne per chiacchierare, lottare
e perfezionare le tue capacità come {tag:0}!

Sembrerebbe che tu non sia iscritt{tag:0}
{pageend:a Nintendo Switch Online.}
Per usufruire del Club globale, è necessario
iscriversi al servizio a pagamento
{pageend:di Nintendo Switch Online.}
Se dovessi decidere di effettuare l’iscrizione,
riprova ad accedere al Club globale.

{pageend:Hai voglia di lottare?}
Va bene, allora chiamerò qualcuno a cui
potrebbe interessare una lotta.

{pageend:Hai voglia di fare uno scambio?}
Va bene, allora chiamerò qualcuno a cui
potrebbe interessare uno scambio.

{pageend:Ti va bene qualsiasi cosa?}
Va bene, allora chiamerò qualcuno che
la pensa come te.

Benvenut{tag:0}{pageend: al Club locale Pokémon!}
Questo è il banco informazioni della Sala locale.
Posso esserti d’aiuto?

Oh! A quanto pare non fai ancora parte
{pageend:di nessun gruppo!}
Riprova dopo essere entrat{tag:0} in un gruppo.

Puoi copiare le capsule decorate dagli altri
{pageend:giocatori e viceversa.}
Metti in cima alla lista la capsula che vuoi
{pageend:mostrare.}
La capsula dell’altro giocatore verrà copiata
{pageend:automaticamente nella tua lista.}
Se non hai tutti i bolli presenti sulla capsula
dell’altro giocatore, potrai copiare solo
quelli già a tua disposizione. Provaci!

Ah! Non ho ancora avuto modo di usare
{pageend:il DecoraBall.}
Scusa, facciamo un’altra volta!

Ah! Non ho ancora avuto modo di usare
{pageend:il DecoraBall.}
Scusa, facciamo un’altra volta!

{tag:0} vuole mostrarti una capsula
{pageend:personalizzata con il DecoraBall.}
Vuoi mostrarne una anche tu?

Benvenut{tag:0}{pageend: nella Sala locale!}
Qui potrai divertirti a scambiare Pokémon
con tante altre persone!
